import React, {useEffect} from "react";

const SecondSibling = (props) =>{

    useEffect(()=>{
        let counterval = props.counter;
        if(counterval % 5 ==0){
            props.counter =5;
        }
        },[props.counter])

    

    return (
        <div>
            <h1>{props.counter}</h1>
        </div>
    )

}

export default SecondSibling;
